create table tbl_customers
(
    id         int auto_increment
        primary key,
    code       varchar(50) null,
    name       varchar(50) null,
    phone      varchar(15) null,
    created_by int         null,
    updated_by int         null,
    created_at bigint      null,
    updated_at bigint      null,
    deleted_at bigint      null,
    deleted_by int         null
)
    collate = utf8mb4_bin;

